import React from 'react';
import './App.css';
import Header from './Header';
import Band from './Band';
import data from './metal.json';

function App() {
  var bands = data.length;
  console.log(data);

  return (
    <div className="App">
      <header className="App-header">
        <Header />
        <p># of Bands: {bands}</p>

        <Band />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
